import React from 'react';
import MyImage from '../assets/img1.png';
import BusImage from '../assets/bus.png';
import TecsupImage from '../assets/tecsup.png';
import GoogleImage from '../assets/google.png';
import '../css/inicio.css';


export function inicio() {
  return (
    <div className='inicio'>
      <div className='image'>
        <img class='image' src={MyImage} alt="login"  />
      </div>
      <div className='content'>
        <div className='top-bar'>TECSUP</div>
        <div className='side-rectangle'>
          <div className="text-container">
            <p className='text'>BusTecsup</p>
            <img src={BusImage} alt="bus" className="bus-image" />
            <img src={TecsupImage} alt="tecsup" className="tecsup-image" />
          </div>
          <label class='label' htmlFor='user'>Usuario</label>
          <input class='label' type='user' id='user' />
          <label class='label'  htmlFor='password' placeholder="Contraseña">Contraseña</label>
          <input  class='label' type='password' id='password' />
          <div className="App">
    </div>
          <button className='btn btn-primary btn-lg btn-block'>Iniciar Sesión</button><br /><br />
          <button className='google'>
        <img className='google'  src={GoogleImage} alt='Google' /></button>
        </div>
      </div>
    </div>
  );
}
export default inicio;
